window.bookSummaryJSON = "<p><b>The world is in peril and fate needs a hero to save it. Sometimes, all fate gets is a bunny. </b></p> <p>She is a dungeon creature bound by the rules of the dungeon. Her job is to do bunny things, like eat and hop, and eventually fall prey to larger creatures. A bunny need do nothing more. However, she cannot help herself. Everyday as adventurers pass through the cave that she calls home, she sees them wielding strange and fascinating magic but more importantly...she hears them talking.</p> <p>Their words are wonderful, and she learns as many of them as she can while trying to ignore the epic tragedy of her life.</p> <p>She is just a bunny, and there is no way that a bunny could ever be like an adventurer, no matter how many words she knows.</p> <p><i>This story is inspired by Dungeon Core and litRPG/gamelit. </i></p>"; 
